float Generate_Sine(float t_A, float t_offset, float t_f, uint32_t t_k, float t_T, int32_t t_phase_lead_index)
{
	float t_y;

	t_y = t_A * sin(2*M_PI*t_f*(t_k + t_phase_lead_index)*t_T) + t_offset;

	return t_y;
}

float Generate_Rectangle_tanh(float t_amp, float t_offset, float t_freq, uint32_t t_k, float t_T, int32_t t_phase_lead_index)
{
	/* section time = settle time = rising time = falling time */
	float t_result, t_time, t_period, t_section_time;		// t_period = rising time + settle time + falling time
	static float t_result_f = 0.0;

	t_amp /= 2;
	t_period = 1/t_freq;			//sec
	t_section_time = t_period/6;	//sec

	t_time = (t_k%((uint32_t)(t_period/t_T)) + t_phase_lead_index)* t_T ;		//ms

//	if(t_time < t_section_time) {
//		t_result = t_amp*tanh(M_PI*(4/t_section_time)*(t_time - t_section_time/2)) + t_amp + t_offset;
//	}
//	else if( (t_time >= t_section_time) && (t_time <= (2*t_section_time)) ) {
//		t_result = 2*t_amp + t_offset;
//	}
//	else if( (t_time > (2*t_section_time)) && (t_time <= (3*t_section_time))) {
//		t_result = -t_amp*tanh(M_PI*(4/t_section_time)*(t_time - t_section_time*5/2)) + t_amp + t_offset;
//	}
//	else if( (t_time > (3*t_section_time)) && (t_time <= (4*t_section_time))) {
//		t_result = t_offset;
//	} else {
//		t_result = t_result_f;
//	}

	if(t_time < t_section_time) {
		t_result = t_amp*tanh(M_PI*(6/t_section_time)*(t_time - t_section_time/2)) + t_amp + t_offset;
	}
	else if( (t_time >= t_section_time) && (t_time <= (2*t_section_time)) ) {
		t_result = 2*t_amp + t_offset;
	}
	else if( (t_time > (2*t_section_time)) && (t_time <= (3*t_section_time))) {
		t_result = t_amp*tanh(M_PI*(6/t_section_time)*(-t_time + t_section_time*5/2)) + t_amp + t_offset;
	}
	else if( (t_time > (3*t_section_time)) && (t_time <= (4*t_section_time))) {
		t_result = t_amp*tanh(M_PI*(6/t_section_time)*(-t_time + t_section_time*7/2)) - t_amp + t_offset;
	}
	else if( (t_time > (4*t_section_time)) && (t_time <= (5*t_section_time))) {
		t_result = -2*t_amp + t_offset;
	}
	else if( (t_time > (5*t_section_time)) && (t_time <= (6*t_section_time))) {
		t_result = t_amp*tanh(M_PI*(6/t_section_time)*(t_time - t_section_time*11/2)) - t_amp + t_offset;
	}
	else {
		t_result = t_result_f;
	}

	t_result_f = t_result;

	return t_result;
}

float Generate_Rectangle(float t_A, float t_offset, float t_f, float t_ratio, uint32_t t_k, float t_T, int8_t t_mode)
{
	float t_frequency;
	float t_y;

	t_frequency = 1/(t_f*t_T);
	while(t_k > t_frequency){
		t_k = t_k - t_frequency;
	}

	if (t_frequency*t_ratio >= t_k)
	{
		t_y = t_A;
	}
	else
	{
		t_y = -t_A;
	}


	if       (t_mode == 1) t_y =  t_y;
	else if (t_mode == -1) t_y = -t_y;

	t_y += t_offset;


	return t_y;
}

float Generate_Stair(float t_A1, float t_A2, uint16_t t_N, float t_dT, uint32_t t_k, float t_T)
{
	float t_stepsize;
	float t_time;
	uint16_t t_index;
	float t_y;

	t_time = t_k * t_T;
	t_stepsize = (t_A2 - t_A1)/t_N;

	t_index = (uint16_t)(t_time/t_dT);

	t_y = t_A1 + t_stepsize * t_index;

	if (t_time > (t_N+1)*t_dT) { t_y = 0; }

	return t_y;
}

float Generate_Ramp(float t_A1, float t_ym, float t_offset, uint32_t t_k, float t_T)
{
	float t_y;

	t_y = t_A1 * (t_k*t_T) + t_offset;

	if (t_y > t_ym) {t_y = 0;}

	return t_y;
}


